// HasReseller applies the HasEdge predicate on the "reseller" edge.
func HasReseller() predicate.ResellerDomain {
	return predicate.ResellerDomain(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, ResellerTable, ResellerColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasResellerWith applies the HasEdge predicate on the "reseller" edge with a given conditions (other predicates).
func HasResellerWith(preds ...predicate.User) predicate.ResellerDomain {
	return predicate.ResellerDomain(func(s *sql.Selector) {
		step := newResellerStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.ResellerDomain) predicate.ResellerDomain {
	return predicate.ResellerDomain(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.ResellerDomain) predicate.ResellerDomain {
	return predicate.ResellerDomain(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.ResellerDomain) predicate.ResellerDomain {
	return predicate.ResellerDomain(sql.NotPredicates(p))
}
